import Todo from "./Todo"

function Todos ( props ) {
    let todos = props.todos
    console.log(todos);
    todos.map( todo => 
        {
        console.log(todo.todoId);
         <Todo todoText={todo.todoText}
            todoId={todo.todoId} />
        })
}

export default Todos
